// SmartMenus init
$(function() {
    $('#main-menu').smartmenus({
      subMenusSubOffsetX: 6,
      subMenusSubOffsetY: -8,
		subMenusMinWidth: '289px',
		subMenusMaxWidth: '289px',
    });
  });



    // SmartMenus mobile menu toggle button
    jQuery(function () {
        var $mainMenuState = jQuery('#main-menu-state');
        
        if ($mainMenuState.length) {
            // animate mobile menu
            $mainMenuState.change(function (e) {
                var $menu = jQuery('#main-menu');
                if (this.checked) {
                    $menu.hide().toggle('slide', { direction: 'right' }, 1000);
                    jQuery('body').css("overflow", "hidden");

                } else {
                    // console.log("hello");
                    $menu.show().toggle('slide', { direction: 'right' }, 1000);
                    jQuery('body').css("overflow", "auto");

                }
            });
            // hide mobile menu beforeunload
            jQuery(window).bind('beforeunload unload', function () {
                if ($mainMenuState[0].checked) {
                    $mainMenuState[0].click();
                }
            });
        }
    });

jQuery(document).ready(resizeMobile);
jQuery(document).ready(resizeDesktop);

jQuery(window).on('resize',resizeMobile);
jQuery(window).on('resize',resizeDesktop);


function resizeMobile() {
    var width = jQuery(window).width();
    if (width < 992) {
         jQuery('.wrapper.smallMenu-wrapper').appendTo('#main-menu');
    }
}
function resizeDesktop() {
    var width = jQuery(window).width();
    if (width > 991) {
      jQuery('.wrapper.smallMenu-wrapper').appendTo('.outer.small-menu');
    }
}
 // Sticky Header
    jQuery(window).scroll(function () {
        if (jQuery(window).scrollTop() > 50) {
            jQuery('.megaMenuOuter').addClass('sticky-header');
        }
        else {
            jQuery('.megaMenuOuter').removeClass('sticky-header');
        }
    });
