// jquery for shrink label top
  
jQuery('#contactForm .form-group input').each(function () {
          
  jQuery(this).focus(function () {
      if (jQuery(this).val().length === 0) {
          jQuery(this).parent().find("label").addClass("newlabel")
      }
      else {
          jQuery(this).parent().find("label").addClass("newlabel")
      }
  });

  jQuery(this).blur(function () {
      if (jQuery(this).val().length === 0) {
          jQuery(this).parent().find("label").removeClass("newlabel")
      }
      else {
          jQuery(this).parent().find("label").addClass("newlabel")
      }
  });            

  if (jQuery(this).val().length != 0) {
      jQuery(this).parent().find("input").addClass("newlabel");
  }
});

jQuery('#contactForm .form-group textarea').each(function () {
          
  jQuery(this).focus(function () {
      if (jQuery(this).val().length === 0) {
          jQuery(this).parent().find("label").addClass("newlabel-blur")
      }
      else {
          jQuery(this).parent().find("label").addClass("newlabel-blur")
      }
  });

  jQuery(this).blur(function () {
      if (jQuery(this).val().length === 0) {
          jQuery(this).parent().find("label").removeClass("newlabel-blur")
      }
      else {
          jQuery(this).parent().find("label").addClass("newlabel-blur")
      }
  });            

  if (jQuery(this).val().length != 0) {
      jQuery(this).parent().find("input").addClass("newlabel-blur");
  }
});

jQuery('.counter').counterUp({
  delay: 10,
  time: 2000
});
jQuery('.counter').addClass('animated fadeInDownBig');
jQuery('h3').addClass('animated fadeIn');